import React from 'react';
import * as FaIcons  from "react-icons/fa";


function Navbar() {

    return (
        <div className="navbar">
            <link  className='menu-bars'>
                <FaIcons.FaBars/>
            </link>
        </div>

    )
}

export default Navbar;
